import React, { Component} from 'react';
//import { render } from '@testing-library/react';

class ApiCall extends Component {
   constructor(props) {
      super(props) ;

         this.state = {
            data : [],
            isLoaded : false,
         }
}

fetchData() {
   fetch('https://api.mocki.io/v1/b043df5a1')
   .then(res => res.json() ) 
   .then(json => {
     this.setState ({
        isLoaded: true,
        data: json,
     })
   });
}


componentDidMount() {

   this.fetchData();

   /*fetch('https://api.mocki.io/v1/b043df5a')
   .then(res => res.json() ) 
