     this.setState ({
        isLoaded: true,
        data: json,
     })
   });*/
}

render() {
   var{isLoaded, data}= this.state;
   if(!isLoaded) {
      return <div> Loading....</div>
   }
   else {
      return (
         <div className='App'> 
            <ul>
               <h3>
                  {data[0].name} 
               </h3>
            </ul>
         </div>
      );
   }
}

}
export default ApiCall;;

